import { Link, NavLink } from 'react-router-dom';
import classes from "./Header.module.css"
export default function Header(){
    return <header className={classes.header}>
        
        <ul>
            <li><NavLink to='/'style={
                ({active})=> {c}
            } className={({active})=> active ? classes.active : undefined }>Home</NavLink></li>
            <li><NavLink to='events' className={({active})=> active ? classes.active : undefined }>Events Page</NavLink></li>
            <li><NavLink to='NewsLetter' className={({active})=> active ? classes.active : undefined }>NewsLetter Page</NavLink></li>
        </ul>

    </header>
}
